import React from 'react';

import classes from './Movie.module.css';

const Movie = (props) => {
  return (
    <li className={classes.movie}>
      <h2>{props.NAME}</h2>
      <h3>{props.Weight}</h3>
      <h4>{props.GENDER}</h4>
      <h5>{props.TALL}</h5>
      {/* <p>{props.openingText}</p> */}
    </li>
  );
};

export default Movie;
